function docollapse(e,t,n=!1){n&&(e=document.getElementById(e),t=document.getElementById(t)),e.classList.add("collapsed"),t.classList.add("show")}function uncollapse(e,t,n=!1){n&&(e=document.getElementById(e),t=document.getElementById(t)),e.classList.remove("collapsed"),t.classList.remove("show")}window.onload=function(){for(buttonp=document.getElementsByClassName("navbar-toggler"),l=buttonp.length,i=0;i<l;i++){var e=document.getElementById(buttonp[i].dataset.bsTarget),t=buttonp[i];t.addEventListener("click",function(n){t.classList.contains("collapsed")?uncollapse(t,e):docollapse(t,e)})}};
